import React from 'react';
import Login from '../../components/account/login';
import { gql, useQuery } from '@apollo/client';
import Loading from "../../components/loading/";

const query = gql`
query{
    loginPage{
      hero{
        title
        background{
          url
        }
      }
    }
  }
`

const login = ({data}) => {
    return <Login hero={data.loginPage.hero}/>;
}

export default login;
